const DE_COMPRESS_VARIANTS_MULTI:any = {};
export const _DE_COMPRESS_MULTI = enums.reduce((r: any, enumeration, n) => {
  const tableIndex = n+3;
  for (const [word, wordIndex] of Object.entries(enumeration).splice(Object.keys(enumeration).length/2)) {

    const w = word.replace(/^_/,'');
    if (!r[w]) {
      r[w] = [tableIndex, wordIndex];
      if (/^[A-Za-zÄÖÜäöü]/.test(w)) {
        const upper = `${w.charAt(0).toUpperCase()}${w.slice(1)}`;
        const lower = `${w.charAt(0).toLowerCase()}${w.slice(1)}`;
        const switched = w.charAt(0) === w.charAt(0).toLowerCase() ? upper : lower;
        DE_COMPRESS_VARIANTS_MULTI[switched] = [_.CASE_SWITCH_NEXT, tableIndex, wordIndex];
      }
      DE_COMPRESS_VARIANTS_MULTI[w.slice(-2)] = [_.DELETE_LAST2, tableIndex, wordIndex];
      DE_COMPRESS_VARIANTS_MULTI[w.slice(-1)] = [_.DELETE_LAST, tableIndex, wordIndex];
      
    }
  }
  return r;
}, {});

